import React, { useState, useEffect } from "react";
import BeerPic from "./BeerPic.js";

const BeerList = () => {
  const [beers, setBeers] = useState();

  useEffect(() => {
    fetch("https://api.punkapi.com/v2/beers?page=2&per_page=24")
      .then((response) => response.json())
      .then((responseData) => {
        setBeers(responseData);
      })
      .catch((error) => {
        console.log("Error fetching and parsing data", error);
      });
  }, []);

  console.log("WTF __OKPOJO", beers && beers);

  if (beers != undefined) {
    return (
      <ul className="beer-list">
        {beers.map((beer) => {
          return <BeerPic url={beer.image_url} key={beer.id} />;
        })}
      </ul>
    );
  } else {
    return <p>loading...</p>;
  }
};

export default BeerList;
